This Mother’s Day, as a momstribe our sincerest wish is for more fitter families with fitter kids and a fitter world. 

And all that fit world begins with more and more fit mothers. 

Fit mothers inspire their children to be fitter too.

Fit children make for more awareness about health in the community. 

Aware and healthy communities makes the city fit. 

Healthy cities make the nation fit and eventually the world. 

So, we mom’s have taken this pledge together as a fit mom tribe on this #MothersDay to start this fitness revolution and celebration to create the fittest version of ourselves. 

After all, the world is depending on us!! 💪💪
